fore editing pages.\nPlease set and validate your e-mail address through your [[Special:Preferences|user preferences]].\";'),('en-gb','messages:nosuchsectiontitle','s:19:\"Cannot find section\";'),('en-gb','messages:nosuchsectiontext','s:115:\"You tried to edit a section that does not exist.\nIt may have been moved or deleted while you were viewing the page.\";'),('en-gb','messages:loginreqtitle','s:14:\"Login required\";'),('en-gb','messages:loginreqlink','s:6:\"log in\";'),('en-gb','messages:loginreqpagetext','s:32:\"You must $1 to view other pages.\";'),('en-gb','messages:accmailtitle','s:14:\"Password sent.\";'),('en-gb','messages:accmailtext','s:200:\"A randomly generated password for [[User talk:$1|$1]] has been sent to $2.\n\nThe password for this new account can be changed on the \'\'[[Special:ChangePassword|change password]]\'\' page upon logging in.\";'),('en-gb','messages:newarticle','s:5:\"(New)\";'),('en-gb','messages:newarticletext','s:239:\"You have followed a link to a page that does not exist yet.\nTo create the page, start typing in the box below (see the [[{{MediaWiki:Helppage}}|help page]] for more info).\nIf you are here by mistake, click your browser\'s \'\'\'back\'\'\' button.\";'),('en-gb','messages:newarticletextanon','s:22:\"{{int:newarticletext}}\";'),('en-gb','messages:talkpagetext','s:31:\"<!-- MediaWiki:talkpagetext -->\";'),('en-gb','messages:anontalkpagetext','s:469:\"----\'\'This is the discussion page for an anonymous user who has not created an account yet, or who does not use it.\nWe therefore have to use the numerical IP address to identify him/her.\nSuch an IP address can be shared by several users.\nIf you are an anonymous user and feel that irrelevant comments have been directed at you, please [[Special:UserLogin/signup|create an account]] or [[Special:UserLogin|log in]] to avoid future confusion with other anonymous users.\'\'\";'),('en-gb','messages:noarticletext','s:296:\"There is currently no text in this page.\nYou can [[