INSERT INTO `searchindex` VALUES (1,'main page',' theu800 price-sheet system allows foru800 administrators tou800 create edit print andu800 delete vehicle price-sheets. theu800 system enables each individual dealership tou800 manage itsu800 ownu800 setu800 ofu800 vehicle accessories. salespeople dealers areu800 also able tou800 login tou800 theu800 system andu800 view useful information about vehicles like msrp . theu800 system wasu800 designed tou800 make printing price-sheets easier asu800 well asu800 allowing foru800 quicker maintenance byu800 sage technicians. mazdau82efrosted-pixelsu82ecau800 indexu82ephpu800 price-sheet system pages pages pages creating_a_price-sheet creating au800 price-sheet useful quick information foru800 sage useful quick information foru800 sage definitions definitions '),(3,'price-sheet',' '),(2,'definitions',' price-sheet au800 price-sheet isu800 anu800 object that contains allu800 ofu800 theu800 information about au800 specific vehicle package. this includes butu800 isu800 notu800 limited tou800 trim feature package accessories. price-sheets areu800 theu800 only objects that canu800 beu800 printed. vehicle au800 vehicle isu800 anu800 object that contains au800 model andu800 au800 feature package. exu800 2013 mazda 3u800 gxu800 wu800 convenience package feature au800 feature isu800 anu800 object that makes upu800 theu800 factory-installed portion ofu800 au800 vehicle exu800 dual-zone au800 cu800 feature package au800 feature package isu800 au800 collection ofu800 features that come factory-installed. exu800 convenience package accessory anu800 accessory isu800 anu800 object that isu800 added tou800 au800 vehicle atu800 theu800 dealership. theu800 list ofu800 available accessories isu800 managed atu800 theu800 dealer level andu800 isu800 unique foru800 each dealer. accessories canu800 also beu800 additional costs. exu800 cargo mats frieght & pdiu800 user au800 user isu800 someone whou800 hasu800 au800 certain level ofu800 access tou800 theu800 system. each user hasu800 au800 username password encrypted permission level first name last name email etcu800 exu800 melmazda password localadmin melissa adzam melu800 pacificmazdau82ecau800 model mvcu800 howu800 theu800 database looks butu800 notu800 theu800 database itsu800 self. view mvcu800 au800 visual template foru800 howu800 theu800 data will beu800 presented. controller mvcu800 au800 definition foru800 theu800 system system\'su800 available functions exu800. login logout create user etcu800 . '),(4,'creating au800 price-sheet',' howu800 tou800 create andu800 print au800 price-sheet create theu800 features features tabu800 . create theu800 features features tabu800 . create theu800 features features tabu800 . au800 click addu800. bu800 enter feature name. cu800 enter model code. du800 press create feature. repeat foru800 each feature that isu800 tou800 beu800 created. theu800 model code isu800 used sou800 that theu800 system will beu800 able tou800 display only relevant features when creating au800 vehicle. create theu800 vehicle vehicles tabu800 . create theu800 vehicle vehicles tabu800 . create theu800 vehicle vehicles tabu800 . au800 click addu800. bu800 enter allu800 fields. cu800 enter asu800 many option codes asu800 needed. du800 select desired vehicle features. eu800 press create package. fu800 repeat steps \'du800\' andu800 \'eu800\' foru800 each option code entered. create theu800 accessories accessories tabu800 . create theu800 accessories accessories tabu800 . create theu800 accessories accessories tabu800 . au800 enter accessory name. bu800 enter model code. cu800 press create accessory. repeat foru800 each accessory that isu800 tou800 beu800 created. create theu800 price-sheet price-sheets tabu800 . create theu800 price-sheet price-sheets tabu800 . create theu800 price-sheet price-sheets tabu800 . au800 click addu800. bu800 enter vehicle model code. cu800 enter vehicle option code. du800 select accessories. eu800 enter exterior colour. fu800 enter interior colour. gu800 press create price-sheet. print theu800 price-sheet price-sheets tabu800 . print theu800 price-sheet price-sheets tabu800 . print theu800 price-sheet price-sheets tabu800 . au800 click print foru800 theu800 price-sheet tou800 beu800 printed . bu800 enter serial number. cu800 enter stock number. du800 select number ofu800 copies. eu800 press print price-sheet. additional information onu800 price-sheet creation additional information onu800 price-sheet creation additional information onu800 price-sheet creation building au800 price-sheet isu800 au800 layered process. au800 price-sheet requires twou800 components au800 vehicle andu800 au800 setu800 ofu800 accessories. au800 vehicle object contains base vehicle information asu800 well asu800 au800 feature package. au800 feature package requires au800 setu800 ofu800 individual features. this means that au800 setu800 ofu800 features exu800. moon roof fogu800 lights dual-zone au800 cu800 etcu800 must beu800 created during theu800 vehicle creation process. once this isu800 done theu800 features areu800 grouped together tou800 create au800 feature package exu800. standard convenience luxury etcu800 . au800 vehicle object canu800 then beu800 created byu800 selecting theu800 year make model code option code andu800 feature package. once au800 vehicle object hasu800 been created itsu800 optional accessories exu800. after market rims thule rack mount cargo mats etcu800 canu800 beu800 created inu800 theu800 accessories tabu800. au800 price-sheet canu800 then beu800 created byu800 selecting au800 vehicle object andu800 au800 custom setu800 ofu800 dealer-specific accessories. each object price-sheets vehicles accessories features andu800 users canu800 beu800 created read updated andu800 deleted atu800 anyu800 time. deletions will cascade through theu800 database su800 tou800 remove anyu800 unused items. anything that relies onu800 theu800 deleted item asu800 au800 keyu800 will beu800 deleted asu800 well. '),(5,'useful quick information foru800 sage',' theu800 system runs onu800 theu800 following software - centos v6u800u82e3u800 osu800 - phpu800 v5u800u82e3u800u82e3u800 front-endu800 - mysql v5u800u82e1u800u82e61u800 databases - codeigniter 2u800u82e1u800u82e0u800 system mvcu800 framework theu800 webu800-based price-sheet system isu800 built upon au800 mvcu800 framework provided byu800 codeigniter . system definitions canu800 beu800 read onu800 theu800 definitions definitions page. problems weu800 encountered areu800 allu800 onu800 theu800 known_issues bugs page. '),(6,'sidebar',' navigation mainpage mainpage-description '),(7,'known issues bugs',' search paging conflict search currently uses post andu800 session. codeigniter unsets session after youu800 leave theu800 page session wasu800 sent tou800 effectively making session behave like post sou800 searching effectively breaks ifu800 theu800 item youu800 want happens tou800 beu800 onu800 theu800 second page. there areu800 ways around itu800 such asu800 searching while onu800 theu800 second page butu800 itu800 itu800\'su800 bugged. weu800 could theoretically fixu800 this byu800 switching tou800 codeigniter sessions butu800 then weu800 runu800 into another issue itu800 will always just return theu800 same results until weu800 unset theu800 session variable. butu800 when tou800 unset itu800 inu800 anyu800 case search isu800 functional right nowu800 andu800 itu800 itu800\'su800 au800 secondary feature sou800 weu800\'reu800 leaving itu800 asu800-isu800. weu800\'veu800 focused onu800 completing primary deliverables only. '),(8,'bigu800 bang',' ');
