INSERT INTO `text` VALUES (1,'\'\'\'MediaWiki has been successfully installed.\'\'\'\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]','utf-8'),(2,'The price-sheet system allows for administrators to create, edit, print, and delete vehicle price-sheets. The system enables each individual dealership to manage its own set of vehicle accessories. Salespeople (dealers) are also able to login to the system and view useful information about vehicles (like MSRP).\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]','utf-8'),(3,'-Definitions-','utf-8'),(4,'=Price-Sheet=\nA price-sheet is an object that contains all of the information about a specific vehicle package. This includes (but is not limited to): trim, feature package, accessories.\n=Vehicle=\nA vehicle is an object that contains a model, and a feature package.\nEx) 2013 Mazda 3 GX w/ Convenience Package\n=Feature=\nA feature is an object that makes up the factory-installed portion of a vehicle\nEx) Dual-Zone A/C\n=Feature Package=\nA feature package is a collection of features that come factory-installed.\nEx) Convenience Package\n=Accessory=\nAn accessory is an object that is added to a vehicle at the dealership. The list of available accessories is managed at the dealer level and is unique for each dealer. Accessories can also be additional costs.\nEx) Cargo mats, frieght & PDI\n=User=\nA user is someone who has a certain level of access to the system. Each user has a username, password (encrypted), permission level, first name, last name, email, etc)\nEx) MelMazda, [password], localAdmin, Melissa, Adzam, mel@pacificmazda.ca\n=Model (MVC)=\nHow the database looks, but not the database its self.\n=View (MVC)=\nA visual template for how the data will be presented.\n=Controller (MVC)=\nA definition for the system\'s available functions (ex. login, logout, create user, etc).','utf-8'),(5,'=Price-Sheet=\nA price-sheet is an object that contains all of the information about a specific vehicle package. This includes (but is not limited to): trim, feature package, accessories.\n=Vehicle=\nA vehicle is an object that contains a model, and a feature package.\nEx) 2013 Mazda 3 GX w/ Convenience Package\n=Feature=\nA feature is an object that makes up the factory-installed portion of a vehicle\nEx) Dual-Zone A/C\n=Feature Package=\nA feature package is a collection of features that come factory-installed.\nEx) Convenience Package\n=Accessory=\nAn accessory is an object that is added to a vehicle at the dealership. The list of available accessories is managed at the dealer level and is unique for each dealer. Accessories can also be additional costs.\nEx) Cargo mats, frieght & PDI\n=User=\nA user is someone who has a certain level of access to the system. Each user has a username, password (encrypted), permission level, first name, last name, email, etc)\n\nEx) MelMazda, [password], localAdmin, Melissa, Adzam, mel@pacificmazda.ca\n\n=Model (MVC)=\nHow the database looks, but not the database its self.\n=View (MVC)=\nA visual template for how the data will be presented.\n=Controller (MVC)=\nA definition for the system\'s available functions (ex. login, logout, create user, etc).','utf-8'),(6,'=Price-Sheet=\nA price-sheet is an object that contains all of the information about a specific vehicle package. This includes (but is not limited to): trim, feature package, accessories.\n=Vehicle=\nA vehicle is an object that contains a model, and a feature