e system. Each user has a username, password (encrypted), permission level, first name, last name, email, etc)\n\nEx) MelMazda, [password], localAdmin, Melissa, Adzam, mel@pacificmazda.ca\n\n=Model (MVC)=\nHow the database looks, but not the database its self.\n=View (MVC)=\nA visual template for how the data will be presented.\n=Controller (MVC)=\nA definition for the system\'s available functions (ex. login, logout, create user, etc).','utf-8'),(11,'The price-sheet system allows for administrators to create, edit, print, and delete vehicle price-sheets. The system enables each individual dealership to manage its own set of vehicle accessories. Salespeople (dealers) are also able to login to the system and view useful information about vehicles (like MSRP).\n\n== Getting started ==\n* [Definitions Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]','utf-8'),(12,'The price-sheet system allows for administrators to create, edit, print, and delete vehicle price-sheets. The system enables each individual dealership to manage its own set of vehicle accessories. Salespeople (dealers) are also able to login to the system and view useful information about vehicles (like MSRP).\n\n== Getting started ==\n* [Definitions: Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]','utf-8'),(13,'The price-sheet system allows for administrators to create, edit, print, and delete vehicle price-sheets. The system enables each individual dealership to manage its own set of vehicle accessories. Salespeople (dealers) are also able to login to the system and view useful information about vehicles (like MSRP).\n\n== Getting started ==\n* [[Definitions|Configuration settings list]]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FA