* [//help.mazda.frosted-pixels.ca/index.php Price-Sheet System]','utf-8'),(25,'The price-sheet system allows for administrators to create, edit, print, and delete vehicle price-sheets. The system enables each individual dealership to manage its own set of vehicle accessories. Salespeople (dealers) are also able to login to the system and view useful information about vehicles (like MSRP).\n\n== Getting started ==\n* [//help.mazda.frosted-pixels.ca/index.php Price-Sheet System]\n* [[Definitions|Definitions]]\n* [[Creating_a_Price-Sheet|Creating a Price-Sheet]]\n* [[Useful Quick Information for Sage]Useful Quick Information for Sage]','utf-8'),(26,'The price-sheet system allows for administrators to create, edit, print, and delete vehicle price-sheets. The system enables each individual dealership to manage its own set of vehicle accessories. Salespeople (dealers) are also able to login to the system and view useful information about vehicles (like MSRP).\n\n== Getting started ==\n* [//help.mazda.frosted-pixels.ca/index.php Price-Sheet System]\n* [[Definitions|Definitions]]\n* [[Creating_a_Price-Sheet|Creating a Price-Sheet]]\n* [[Useful Quick Information for Sage]|Useful Quick Information for Sage]]','utf-8'),(27,'The price-sheet system allows for administrators to create, edit, print, and delete vehicle price-sheets. The system enables each individual dealership to manage its own set of vehicle accessories. Salespeople (dealers) are also able to login to the system and view useful information about vehicles (like MSRP).\n\n== Getting started ==\n* [//help.mazda.frosted-pixels.ca/index.php Price-Sheet System]\n* [[Definitions|Definitions]]\n* [[Creating_a_Price-Sheet|Creating a Price-Sheet]]\n* [[Useful Quick Information for Sage|Useful Quick Information for Sage]]','utf-8'),(28,'The system runs on the following software:\n - CentOS v6.3 (OS)\n - PHP v5.3.3 (front-end)\n - MySQL v5.1.61 (databases)\n - Codeigniter 2.1.0 (system MVC framework)\n\nThe Web-based Price-Sheet System is built upon a MVC framework (provided by [http://http://codeigniter.com/ Codeigniter]).\n\nSystem definitions can be read on the [[Definitions|definitions]] page.','utf-8'),(29,'==How to Create and Print a Price-Sheet==\n 1) Create the vehicle.\n  a) Create vehicle features (Features tab).\n  b) Create vehicle (Vehicles tab).\n 2) Create the accessories (Accessories tab).\n  a) Enter accessory name.\n  b) Press Submit.\n 3)','utf-8'),(30,'==How to Create and Print a Price-Sheet==\n===1) Create the vehicle.===\n  a) Create vehicle features (Features tab).\n  b) Create vehicle (Vehicles tab).\n 2) Create the accessories (Accessories tab).\n  a) Enter accessory name.\n  b) Press Submit.\n 3)','utf-8'),(31,'==How to Create and Print a Price-Sheet==\n===1) Create the vehicle.===\n  a) Create vehicle features (Features tab).\n  b) Create vehicle (Vehicles tab).\n\n===2) Create the accessories (Accessories tab).===\n  a) Enter accessory name.\n  b) Press Submit.\n\n===3)===','utf-8'),(32,'==How to Create and Print a Price-Sheet==\n===Create the vehicle.===\n  a) Create vehicle features (Features tab).\n  b) Create vehicle (Vehicles tab).\n\n===Create the accessories (Accessories tab).===\n  a) Enter accessory name.\n  b) Press Submit.\n\n===Create the Price-Sheet.===','utf-8'),(33,'==How to Create and Print a Price-Sheet==\n===Create the vehicle.===\n  a) Create vehicle features (Features tab).\n  b) Create vehicle (Vehicles tab).\n\n===Create the accessories (Accessories tab).===\n  a) Enter accessory name.\n  b) Press Submit.\n\n===Create the Price-Sheet (Price-Sheet tab).===\n  a) Click Add.\n  b) Select vehicle.\n  c) Select accessories.\n  d) Press Submit.\n\n===Print the Price-Sheet (Price-Sheet tab).===\n  a) Click Print (for the price-sheet to be printed).\n  b) Enter serial number.\n  c) Enter stock number.\n  d) Select number of copies.\n  e) Press Submit.','utf-8'),(34,'==How to Create and Print a Price-Sheet==\n===Create the vehicle (Vehicles tab).===\n  a) Click Add.\n  b) Select trim.\n  c) Select year.\n  d) Enter model code.\n  e) Enter option code.\n  f) Select colour.\n  g) Select desired vehicle features.\n  h) Press Submit.\n\n===Create the accessories (Accessories tab).===\n  a) Enter accessory name.\n  b) Press Submit.\n\n===Create the Price-Sheet (Price-Sheets tab).===\n  a) Click Add.\n  b) Select vehicle.\n  c) Select accessories.\n  d) Press Submit.\n\n===Print the Price-Sheet (Price-Sheets tab).===\n  a) Click Print (for the price-sheet to be printed).\n  b) Enter serial number.\n  c) Enter stock number.\n  d) Select number of copies.\n  e) Press Submit.','utf-8'),(35,'The price-sheet system allows for administrators to create, edit, print, and delete vehicle price-sheets. The system enables each individual dealership to manage its own set of vehicle accessories. Salespeople (dealers) are also able to login to the system and view useful information about vehicles (like MSRP).\n\n== Getting started ==\n* [//help.mazda.frosted-pixels.ca/index.php Price-Sheet System]\n* [[Creating_a_Price-Sheet|Creating a Price-Sheet]]\n* [[Useful Quick Information for Sage|Useful Quick Information for Sage]]\n* [[Definitions|Definitions]]','utf-8'),(36,'==How to Create and Print a Price-Sheet==\n===Create the vehicle (Vehicles tab).===\n  a) Click Add.\n  b) Select trim.\n  c) Select year.\n  d) Enter model code.\n  e) Enter option code.\n  f) Select colour.\n  g) Select desired vehicle features.\n  h) Press Submit.\n\n===Create the accessories (Accessories tab).===\n  a) Enter accessory name.\n  b) Press Submit.\n\n===Create the Price-Sheet (Price-Sheets tab).===\n  a) Click Add.\n  b) Select vehicle.\n  c) Select accessories.\n  d) Press Submit.\n\n===Print the Price-Sheet (Price-Sheets tab).===\n  a) Click Print (for the price-sheet to be printed).\n  b) Enter serial number.\n  c) Enter stock number.\n  d) Select number of copies.\n  e) Press Submit.\n\nEach vehicle, accessory, and price-sheet can be viewed, edited, and deleted via its specific tab.','utf-8'),(37,'==How to Create and Print a Price-Sheet==\n===Create the vehicle (Vehicles tab).===\n  a) Click Add.\n  b) Select trim.\n  c) Select year.\n  d) Enter model code.\n  e) Enter option code.\n  f) Select colour.\n  g) Select desired vehicle features.\n  h) Press Submit.\n\n===Create the accessories (Accessories tab).===\n  a) Enter accessory name.\n  b) Press Submit.\n\n===Create the Price-Sheet (Price-Sheets tab).===\n  a) Click Add.\n  b) Select vehicle.\n  c) Select accessories.\n  d) Press Submit.\n\n===Print the Price-Sheet (Price-Sheets tab).===\n  a) Click Print (for the price-sheet to be printed).\n  b) Enter serial number.\n  c) Enter stock number.\n  d) Select number of copies.\n  e) Press Submit.\n\nBuilding a price-sheet is a layered process. A price-sheet requires two components: a vehicle and a set of accessories. A vehicle object requires a feature package to be created. A feature package requires a set of individual features. This means that a set of features (ex. Moon Roof, Fog Lights, Dual-Zone A/C, etc) must be created before anything else. Once this is done, the features can be assembled to create a feature package (ex. Standard, Convenience, Luxury, etc). A vehicle object can then be created by selecting the year, make, model code, option code, and feature package.\nOnce a vehicle object has been created, its (optional) accessories (ex. After Market Rims, THULE Rack Mount, Cargo Mats, etc) can be created in the Accessories tab. A price-sheet can then be created by selecting a vehicle object and a custom set of accessories.\nEach object (Price-Sheets, Vehicles, Accessories, Features, and Feature Packages) can be created, read, updated and deleted at any time. Deletions will cascade through the database(s) to remove unused items. Anything that is relying on the deleted item as a key will be deleted as well.\n\n==Additional Information on Price-Sheet Creation==\n\nEach vehicle, accessory, and price-sheet can be viewed, edited, and deleted via its specific tab.','utf-8'),(38,'==How to Create and Print a Price-Sheet==\n===Create the vehicle (Vehicles tab).===\n  a) Click Add.\n  b) Select trim.\n  c) Select year.\n  d) Enter model code.\n  e) Enter option code.\n  f) Select colour.\n  g) Select desired vehicle features.\n  h) Press Submit.\n\n===Create the accessories (Accessories tab).===\n  a) Enter accessory name.\n  b) Press Submit.\n\n===Create the Price-Sheet (Price-Sheets tab).===\n  a) Click Add.\n  b) Select vehicle.\n  c) Select accessories.\n  d) Press Submit.\n\n===Print the Price-Sheet (Price-Sheets tab).===\n  a) Click Print (for the price-sheet to be printed).\n  b) Enter serial number.\n  c) Enter stock number.\n  d) Select number of copies.\n  e) Press Submit.\n\n==Additional Information on Price-Sheet Creation==\n\nBuilding a price-sheet is a layered process. A price-sheet requires two components: a vehicle and a set of accessories. A vehicle object requires a feature package to be created. A feature package requires a set of individual features. This means that a set of features (ex. Moon Roof, Fog Lights, Dual-Zone A/C, etc) must be created before anything else. Once this is done, the features can be assembled to create a feature package (ex. Standard, Convenience, Luxury, etc). A vehicle object can then be created by selecting the year, make, model code, option code, and feature package.\n\nOnce a vehicle object has been created, its (optional) accessories (ex. After Market Rims, THULE Rack Mount, Cargo Mats, etc) can be created in the Accessories tab. A price-sheet can then be created by selecting a vehicle object and a custom set of accessories.\n\nEach object (Price-Sheets, Vehicles, Accessories, Features, and Feature Packages) can be created, read, updated and deleted at any time. Deletions will cascade through the database(s) to remove unused items. Anything that is relying on the deleted item as a key will be deleted as well.','utf-8'),(39,'The price-sheet system allows for administrators to create, edit, print, and delete vehicle price-sheets. The system enables each individual dealership to manage its own set of vehicle accessories. Salespeople (dealers) are also able to login to the system and view useful information about vehicles (like MSRP).\n\nThe system was created to make printing price-sheets easier as well as allowing for quicker maintenance, by Sage technicians.\n\n== Getting started ==\n* [//help.mazda.frosted-pixels.ca/index.php Price-Sheet System]\n* [[Creating_a_Price-Sheet|Creating a Price-Sheet]]\n* [[Useful Quick Information for Sage|Useful Quick Information for Sage]]\n* [[Definitions|Definitions]]','utf-8'),(40,'The price-sheet system allows for administrators to create, edit, print, and delete vehicle price-sheets. The system enables each individual dealership to manage its own set of vehicle accessories. Salespeople (dealers) are also able to login to the system and view useful information about vehicles (like MSRP).\n\nThe system was designed to make printing price-sheets easier as well as allowing for quicker maintenance, by Sage technicians.\n\n== Getting started ==\n* [//help.mazda.frosted-pixels.ca/index.php Price-Sheet System]\n* [[Creating_a_Price-Sheet|Creating a Price-Sheet]]\n* [[Useful Quick Information for Sage|Useful Quick Information for Sage]]\n* [[Definitions|Definitions]]','utf-8'),(41,'\n* navigation\n** mainpage|mainpage-description','utf-8'),(42,'==How to Create and Print a Price-Sheet==\n===Create the vehicle (Vehicles tab).===\n  a) Click Add.\n  b) Select trim.\n  c) Select year.\n  d) Enter model code.\n  e) Enter option code.\n  f) Select colour.\n  g) Select desired vehicle features.\n  h) Press Submit.\n\n===Create the accessories (Accessories tab).===\n  a) Enter accessory name.\n  b) Press Submit.\n\n===Create the Price-Sheet (Price-Sheets tab).===\n  a) Click Add.\n  b) Select vehicle.\n  c) Select accessories.\n  d) Press Submit.\n\n===Print the Price-Sheet (Price-Sheets tab).===\n  a) Click Print (for the price-sheet to be printed).\n  b) Enter serial number.\n  c) Enter stock number.\n  d) Select number of copies.\n  e) Press Submit.\n\n==Additional Information on Price-Sheet Creation==\n\nBuilding a price-sheet is a layered process. A price-sheet requires two components: a vehicle and a set of accessories. A vehicle object contains base vehicle information as well as a feature package. A feature package requires a set of individual features. This means that a set of features (ex. Moon Roof, Fog Lights, Dual-Zone A/C, etc) must be created during the vehicle creation process. Once this is done, the features are stored assembled to create a feature package (ex. Standard, Convenience, Luxury, etc). A vehicle object can then be created by selecting the year, make, model code, option code, and feature package.\n\nOnce a vehicle object has been created, its (optional) accessories (ex. After Market Rims, THULE Rack Mount, Cargo Mats, etc) can be created in the Accessories tab. A price-sheet can then be created by selecting a vehicle object and a custom set of accessories.\n\nEach object (Price-Sheets, Vehicles, Accessories, Features, and Feature Packages) can be created, read, updated and deleted at any time. Deletions will cascade through the database(s) to remove unused items. Anything that is relying on the deleted item as a key will be deleted as well.','utf-8'),(43,'The price-sheet system allows for administrators to create, edit, print, and delete vehicle price-sheets. The system enables each individual dealership to manage its own set of vehicle accessories. Salespeople (dealers) are also able to login to the system and view useful information about vehicles (like MSRP).\n\nThe system was designed to make printing price-sheets easier as well as allowing for quicker maintenance, by Sage technicians.\n\n== Getting started ==\n* [//mazda.frosted-pixels.ca/index.php Price-Sheet System]\n* [[Creating_a_Price-Sheet|Creating a Price-Sheet]]\n* [[Useful Quick Information for Sage|Useful Quick Information for Sage]]\n* [[Definitions|Definitions]]','utf-8'),(44,'==How to Create and Print a Price-Sheet==\n===Create the vehicle (Vehicles tab).===\n  a) Click Add.\n  b) Select trim.\n  c) Select year.\n  d) Enter model code.\n  e) Enter option code.\n  f) Select colour.\n  g) Select desired vehicle features.\n  h) Press Submit.\n\n===Create the accessories (Accessories tab).===\n  a) Enter accessory name.\n  b) Press Submit.\n\n===Create the Price-Sheet (Price-Sheets tab).===\n  a) Click Add.\n  b) Select vehicle.\n  c) Select accessories.\n  d) Press Submit.\n\n===Print the Price-Sheet (Price-Sheets tab).===\n  a) Click Print (for the price-sheet to be printed).\n  b) Enter serial number.\n  c) Enter stock number.\n  d) Select number of copies.\n  e) Press Submit.\n\n==Additional Information on Price-Sheet Creation==\n\nBuilding a price-sheet is a layered process. A price-sheet requires two components: a vehicle and a set of accessories. A vehicle object contains base vehicle information as well as a feature package. A feature package requires a set of individual features. This means that a set of features (ex. Moon Roof, Fog Lights, Dual-Zone A/C, etc) must be created during the vehicle creation process. Once this is done, the features are grouped together to create a feature package (ex. Standard, Convenience, Luxury, etc). A vehicle object can then be created by selecting the year, make, model code, option code, and feature package.\n\nOnce a vehicle object has been created, its (optional) accessories (ex. After Market Rims, THULE Rack Mount, Cargo Mats, etc) can be created in the Accessories tab. A price-sheet can then be created by selecting a vehicle object and a custom set of dealer-specific accessories.\n\nEach object (Price-Sheets, Vehicles, Accessories, Features, and Users) can be created, read, updated and deleted at any time. Deletions will cascade through the database(s) to remove any unused items. Anything that relies on the deleted item, as a key, will be deleted as well.','utf-8'),(45,'==How to Create and Print a Price-Sheet==\n\n===Create the features (Features tab).===\n  a) Click add.\n  b) Enter feature name.\n  c) Enter model code.\n  d) Press Create Feature.\nThe model code is used so that the system will be able to display only relevant features when creating a vehicle.\n\n===Create the vehicle (Vehicles tab).===\n  a) Click Add.\n  b) Select trim.\n  c) Select year.\n  d) Enter model code.\n  e) Enter option code.\n  f) Select colour.\n  g) Select desired vehicle features.\n  h) Press Submit.\n\n===Create the accessories (Accessories tab).===\n  a) Enter accessory name.\n  b) Press Submit.\n\n===Create the Price-Sheet (Price-Sheets tab).===\n  a) Click Add.\n  b) Select vehicle.\n  c) Select accessories.\n  d) Press Submit.\n\n===Print the Price-Sheet (Price-Sheets tab).===\n  a) Click Print (for the price-sheet to be printed).\n  b) Enter serial number.\n  c) Enter stock number.\n  d) Select number of copies.\n  e) Press Submit.\n\n==Additional Information on Price-Sheet Creation==\n\nBuilding a price-sheet is a layered process. A price-sheet requires two components: a vehicle and a set of accessories. A vehicle object contains base vehicle information as well as a feature package. A feature package requires a set of individual features. This means that a set of features (ex. Moon Roof, Fog Lights, Dual-Zone A/C, etc) must be created during the vehicle creation process. Once this is done, the features are grouped together to create a feature package (ex. Standard, Convenience, Luxury, etc). A vehicle object can then be created by selecting the year, make, model code, option code, and feature package.\n\nOnce a vehicle object has been created, its (optional) accessories (ex. After Market Rims, THULE Rack Mount, Cargo Mats, etc) can be created in the Accessories tab. A price-sheet can then be created by selecting a vehicle object and a custom set of dealer-specific accessories.\n\nEach object (Price-Sheets, Vehicles, Accessories, Features, and Users) can be created, read, updated and deleted at any time. Deletions will cascade through the database(s) to remove any unused items. Anything that relies on the deleted item, as a key, will be deleted as well.','utf-8'),(46,'==How to Create and Print a Price-Sheet==\n\n===Create the features (Features tab).===\n  a) Click add.\n  b) Enter feature name.\n  c) Enter model code.\n  d) Press Create Feature.\nRepeat for each feature that is to be created.\nThe model code is used so that the system will be able to display only relevant features when creating a vehicle.\n\n===Create the vehicle (Vehicles tab).===\n  a) Click Add.\n  b) Select trim.\n  c) Select year.\n  d) Enter model code.\n  e) Enter option code.\n  f) Select colour.\n  g) Select desired vehicle features.\n  h) Press Submit.\n\n===Create the accessories (Accessories tab).===\n  a) Enter accessory name.\n  b) Press Create Accessory.\nRepeat for each accessory that is to be created.\n\n===Create the Price-Sheet (Price-Sheets tab).===\n  a) Click Add.\n  b) Select vehicle.\n  c) Select accessories.\n  d) Press Create Price-Sheet.\n\n===Print the Price-Sheet (Price-Sheets tab).===\n  a) Click Print (for the price-sheet to be printed).\n  b) Enter serial number.\n  c) Enter stock number.\n  d) Select number of copies.\n  e) Press Print Price-Sheet.\n\n==Additional Information on Price-Sheet Creation==\n\nBuilding a price-sheet is a layered process. A price-sheet requires two components: a vehicle and a set of accessories. A vehicle object contains base vehicle information as well as a feature package. A feature package requires a set of individual features. This means that a set of features (ex. Moon Roof, Fog Lights, Dual-Zone A/C, etc) must be created during the vehicle creation process. Once this is done, the features are grouped together to create a feature package (ex. Standard, Convenience, Luxury, etc). A vehicle object can then be created by selecting the year, make, model code, option code, and feature package.\n\nOnce a vehicle object has been created, its (optional) accessories (ex. After Market Rims, THULE Rack Mount, Cargo Mats, etc) can be created in the Accessories tab. A price-sheet can then be created by selecting a vehicle object and a custom set of dealer-specific accessories.\n\nEach object (Price-Sheets, Vehicles, Accessories, Features, and Users) can be created, read, updated and deleted at any time. Deletions will cascade through the database(s) to remove any unused items. Anything that relies on the deleted item, as a key, will be deleted as well.','utf-8'),(47,'==How to Create and Print a Price-Sheet==\n\n===Create the features (Features tab).===\n  a) Click add.\n  b) Enter feature name.\n  c) Enter model code.\n  d) Press Create Feature.\nRepeat for each feature that is to be created.\nThe model code is used so that the system will be able to display only relevant features when creating a vehicle.\n\n===Create the vehicle (Vehicles tab).===\n  a) Click Add.\n  b) Select trim.\n  c) Select year.\n  d) Enter model code.\n  e) Enter option code.\n  f) Select colour.\n  g) Select desired vehicle features.\n  h) Press Create Vehicle.\n\n===Create the accessories (Accessories tab).===\n  a) Enter accessory name.\n  b) Press Create Accessory.\nRepeat for each accessory that is to be created.\n\n===Create the Price-Sheet (Price-Sheets tab).===\n  a) Click Add.\n  b) Select vehicle.\n  c) Select accessories.\n  d) Press Create Price-Sheet.\n\n===Print the Price-Sheet (Price-Sheets tab).===\n  a) Click Print (for the price-sheet to be printed).\n  b) Enter serial number.\n  c) Enter stock number.\n  d) Select number of copies.\n  e) Press Print Price-Sheet.\n\n==Additional Information on Price-Sheet Creation==\n\nBuilding a price-sheet is a layered process. A price-sheet requires two components: a vehicle and a set of accessories. A vehicle object contains base vehicle information as well as a feature package. A feature package requires a set of individual features. This means that a set of features (ex. Moon Roof, Fog Lights, Dual-Zone A/C, etc) must be created during the vehicle creation process. Once this is done, the features are grouped together to create a feature package (ex. Standard, Convenience, Luxury, etc). A vehicle object can then be created by selecting the year, make, model code, option code, and feature package.\n\nOnce a vehicle object has been created, its (optional) accessories (ex. After Market Rims, THULE Rack Mount, Cargo Mats, etc) can be created in the Accessories tab. A price-sheet can then be created by selecting a vehicle object and a custom set of dealer-specific accessories.\n\nEach object (Price-Sheets, Vehicles, Accessories, Features, and Users) can be created, read, updated and deleted at any time. Deletions will cascade through the database(s) to remove any unused items. Anything that relies on the deleted item, as a key, will be deleted as well.','utf-8'),(48,'Search/Paging conflict\nSearch currently uses POST and SESSION. Codeigniter unsets SESSION after you leave the page SESSION was sent to (Effectively making SESSION behave like POST), so searching effectively breaks if the item you want happens to be on the second page. There are ways around it (Such as searching while on the second page) but it\'s bugged.\n\nWe could theoretically fix this by switching to Codeigniter Sessions, but then we run into another issue: It will always just return the same results until we unset the session variable. But when to unset it?\n\nIn any case, Search is \"functional\" right now and it\'s a secondary feature, so we\'re leaving it as-is. We\'re already in negative time after the [[Big Bang]], so we\'re focusing on completing primary requirements and finishing the project.','utf-8'),(49,'Completely unnecessary story time!\n\n- The final week of school. The project is nearing completion, today should mark the completion of the code for the sight (excluding minor tweaks requested by the staff during test week).\n\n-Bright-faced and ready to go, I notice the lights flicker as I\'m leaving my house to head to Pacific Mazda. Bus ride\'s uneventful as usual, and I rush up the stairs to our little office-esque area Michael so graciously provided. Being the first one here, I proceed to unpack and get ready to get to work. Today should be wonderful!\n\n-I fire up putty, already thinking of what needs to be tweaked, what needs refineme-\n\n->NETWORK ERROR: Connection timed out\n\n\"Huh, that\'s odd...\" *wiggles the server\'s mouse*\n\nNothing.\n\nChecks server, Network light is on. Good sign. *presses power button*\n\nNothing.\n\n*holds power button for egregiously long time*\n\nNothing.\n\nAt this point, I\'m experiencing a *totally mild* panic attack. Michael\'s walking up the stairs, just passing by on his way to his office.\n\n\"How\'s the project going?\"\n\"uh, well, the server\'s not starting\"\n\nAfter going through all the troubleshooting again, and a few more, he calls down a local technician to see what can be done. We\'re pretty sure the power supply fried at this point.\n\nAfter spending a few hours sweating, wondering what\'s to become of our weeks of work, the technician arrives! yay!\n...and he didn\'t bring a screwdriver, or any tools. Confidence levels just joined the Titanic.\n\nLuckily, I always pack way too much unnecessary stuff. my multi-tool keychain happens to fit the screws on the inside of this case, so we get the large plastic cover off of the internals to find out the worst possible thing: The three drives are antiques, and hooked up to a proprietary RAID controller (which is also an antique) with a custom RAID configuration. The data was unrecoverable.\n\nAnd that, my friends, is why backups should be ingrained into every fledgeling programmers mind. Before they reach second year, preferably.\n\nOn the bright side','utf-8'),(50,'Completely unnecessary story time!\n\n\'\'The final week of school. The project is nearing completion, today should mark the completion of the code for the sight (excluding minor tweaks requested by the staff during test week).\n\nBright-faced and ready to go, I notice the lights flicker as I\'m leaving my house to head to Pacific Mazda. Bus ride\'s uneventful as usual, and I rush up the stairs to our little office-esque area Michael so graciously provided. Being the first one here, I proceed to unpack and get ready to get to work. Today should be wonderful!\n\nI fire up putty, already thinking of what needs to be tweaked, what needs refineme-\n\n>NETWORK ERROR: Connection timed out\n\n\"Huh, that\'s odd...\" *wiggles the server\'s mouse*\n\nNothing.\n\nChecks server, Network light is on. Good sign. *presses power button*\n\nNothing.\n\n*holds power button for egregiously long time*\n\nNothing.\n\nAt this point, I\'m experiencing a *totally mild* panic attack. Michael\'s walking up the stairs, just passing by on his way to his office.\n\n\"How\'s the project going?\"\n\"uh, well, the server\'s not starting\"\n\nAfter going through all the troubleshooting again, and a few more, he calls down a local technician to see what can be done. We\'re pretty sure the power supply fried at this point.\n\nAfter spending a few hours sweating, wondering what\'s to become of our weeks of work, the technician arrives! yay!\n...and he didn\'t bring a screwdriver, or any tools. Confidence levels just joined the Titanic.\n\nLuckily, I always pack way too much unnecessary stuff. my multi-tool keychain happens to fit the screws on the inside of this case, so we get the large plastic cover off of the internals to find out the worst possible thing: The three drives are antiques, and hooked up to a proprietary RAID controller (which is also an antique) with a custom RAID configuration. The data was unrecoverable.\'\'\n\nAnd that, my friends, is why back