as-is. We\'re already in negative time after \n the [[Big Bang]], so we\'re focusing on completing primary requirements and finishing the project.','utf-8'),(55,'The system runs on the following software:\n - CentOS v6.3 (OS)\n - PHP v5.3.3 (front-end)\n - MySQL v5.1.61 (databases)\n - Codeigniter 2.1.0 (system MVC framework)\n\nThe Web-based Price-Sheet System is built upon a MVC framework (provided by [http://http://codeigniter.com/ Codeigniter]).\n\nSystem definitions can be read on the [[Definitions|definitions]] page.\n\nProblems we encountered are all on the [[Known_Issues/Bugs]] page.','utf-8'),(56,'','utf-8'),(57,'Search/Paging conflict:\n Search currently uses POST and SESSION. Codeigniter unsets SESSION after you leave the page SESSION was sent to (Effectively making SESSION \n behave like POST), so searching effectively breaks if the item you want happens to be on the second page. There are ways around it (Such as \n searching while on the second page) but it\'s bugged.\n \n We could theoretically fix this by switching to Codeigniter Sessions, but then we run into another issue: It will always just return the same \n results until we unset the session variable. But when to unset it?\n \n In any case, Search is \"functional\" right now and it\'s a secondary feature, so we\'re leaving it as-is. We\'ve focused on completing primary deliverables only.','utf-8'),(58,'The price-sheet system allows for administrators to create, edit, print, and delete vehicle price-sheets. The system enables each individual dealership to manage its own set of vehicle accessories. Salespeople (dealers) are also able to login to the system and view useful information about vehicles (like MSRP).\n\nThe system was designed to make printing price-sheets easier as well as allowing for quicker maintenance, by Sage technicians.\n\n== Pages ==\n* [//mazda.frosted-pixels.ca/index.php Price-Sheet System]\n* [[Creating_a_Price-Sheet|Creating a Price-Sheet]]\n* [[Useful Quick Information for Sage|Useful Quick Information for Sage]]\n* [[Definitions|Definitions]]','utf-8'),(59,'The price-sheet system allows for administrators to create, edit, print, and delete vehicle price-sheets. The system enables each individual dealership to manage its own set of vehicle accessories. Salespeople (dealers) are also able to login to the system and view useful information about vehicles (like MSRP).\n\nThe system was designed to make printing price-sheets easier as well as allowing for quicker maintenance, by Sage technicians.\n\n== Pages ==\n* [[Creating_a_Price-Sheet|Creating a Price-Sheet]]\n* [[Useful Quick Information for Sage|Useful Quick Information for Sage]]\n* [[Definitions|Definitions]]','utf-8'),(60,'The price-sheet system allows for administrators to create, edit, print, and delete vehicle price-sheets. The system enables each individual dealership to manage its own set of vehicle accessories. Salespeople (dealers) are also able to login to the system and view useful information about vehicles (like MSRP).\n\nThe system was designed to make printing price-sheets easier as well as allowing for quicker maintenance, by Sage technicians.\n\n* [//mazda.frosted-pixels.ca/index.php Price-Sheet System]\n\n== Pages ==\n* [[Creating_a_Price-Sheet|Creating a Price-Sheet]]\n* [[Useful Quick Information for Sage|Useful Quick Information for Sage]]\n* [[Definitions|Definitions]]','utf-8'),(61,'The price-sheet system allows for administrators to create, edit, print, and delete vehicle price-sheets. The system enables each individual dealership to manage its own set of vehicle accessories. Salespeople (dealers) are also able to login to the system and view useful information about vehicles (like MSRP).\n\nThe system was designed to make printing price-sheets easier as well as allowing for quicker maintenance, by Sage technicians.\n\n[//mazda.frosted-pixels.ca/index.php Price-Sheet System]\n\n== Pages ==\n* [[Creating_a_Price-Sheet|Creating a Price-Sheet]]\n* [[Useful Quick Information for Sage|Useful Quick Information for Sage]]\n* [[Definitions|Definitions]]','utf-8'),(62,'==How to Create and Print a Price-Sheet==\n\n===Create the features (Features tab).===\n  a) Click add.\n  b) Enter feature name.\n  c) Enter model code.\n  d) Press Create Feature.\nRepeat for each feature that is to be created.\nThe model code is used so that the system will be able to display only relevant features when creating a vehicle.\n\n===Create the vehicle (Vehicles tab).===\n  a) Click Add.\n  b) Enter all fields.\n  c) Enter as many option codes as needed.\n  d) Select desired vehicle features.\n  e) Press Create Package.\n  f) Repeat steps \'d\' and \'e\' for each option code entered.\n\n===Create the accessories (Accessories tab).===\n  a) Enter accessory name.\n  b) Press Create Accessory.\nRepeat for each accessory that is to be created.\n\n===Create the Price-Sheet (Price-Sheets tab).===\n  a) Click Add.\n  b) Select vehicle.\n  c) Select accessories.\n  d) Press Create Price-Sheet.\n\n===Print the Price-Sheet (Price-Sheets tab).===\n  a) Click Print (for the price-sheet to be printed).\n  b) Enter serial number.\n  c) Enter stock number.\n  d) Select number of copies.\n  e) Press Print Price-Sheet.\n\n==Additional Information on Price-Sheet Creation==\n\nBuilding a price-sheet is a layered process. A price-sheet requires two components: a vehicle and a set of accessories. A vehicle object contains base vehicle information as well as a feature package. A feature package requires a set of individual features. This means that a set of features (ex. Moon Roof, Fog Lights, Dual-Zone A/C, etc) must be created during the vehicle creation process. Once this is done, the features are grouped together to create a feature package (ex. Standard, Convenience, Luxury, etc). A vehicle object can then be created by selecting the year, make, model code, option code, and feature package.\n\nOnce a vehicle object has been created, its (optional) accessories (ex. After Market Rims, THULE Rack Mount, Cargo Mats, etc) can be created in the Accessories tab. A price-sheet can then be created by selecting a vehicle object and a custom set of dealer-specific accessories.\n\nEach object (Price-Sheets, Vehicles, Accessories, Features, and Users) can be created, read, updated and deleted at any time. Deletions will cascade through the database(s) to remove any unused items. Anything that relies on the deleted item, as a key, will be deleted as well.','utf-8'),(63,'==How to Create and Print a Price-Sheet==\n\n===Create the features (Features tab).===\n  a) Click add.\n  b) Enter feature name.\n  c) Enter model code.\n  d) Press Create Feature.\nRepeat for each feature that is to be created.\nThe model code is used so that the system will be able to display only relevant features when creating a vehicle.\n\n===Create the vehicle (Vehicles tab).===\n  a) Click Add.\n  b) Enter all fields.\n  c) Enter as many option codes as needed.\n  d) Select desired vehicle features.\n  e) Press Create Package.\n  f) Repeat steps \'d\' and \'e\' for each option code entered.\n\n===Create the accessories (Accessories tab).===\n  a) Enter accessory name.\n  b) Press Create Accessory.\nRepeat for each accessory that is to be created.\n\n===Create the Price-Sheet (Price-Sheets tab).===\n  a) Click Add.\n  b) Enter vehicle model code.\n  c) Enter vehicle option code.\n  d) Select accessories.\n  e) Enter exterior colour.\n  f) Enter interior colour.\n  g) Press Create Price-Sheet.\n\n===Print the Price-Sheet (Price-Sheets tab).===\n  a) Click Print (for the price-sheet to be printed).\n  b) Enter serial number.\n  c) Enter stock number.\n  d) Select number of copies.\n  e) Press Print Price-Sheet.\n\n==Additional Information on Price-Sheet Creation==\n\nBuilding a price-sheet is a layered process. A price-sheet requires two components: a vehicle and a set of accessories. A vehicle object contains base vehicle information as well as a feature package. A feature package requires a set of individual features. This means that a set of features (ex. Moon Roof, Fog Lights, Dual-Zone A/C, etc) must be created during the vehicle creation process. Once this is done, the features are grouped together to create a feature package (ex. Standard, Convenience, Luxury, etc). A vehicle object can then be created by selecting the year, make, model code, option code, and feature package.\n\nOnce a vehicle object has been created, its (optional) accessories (ex. After Market Rims, THULE Rack Mount, Cargo Mats, etc) can be created in the Accessories tab. A price-sheet can then be created by selecting a vehicle object and a custom set of dealer-specific accessories.\n\nEach object (Price-Sheets, Vehicles, Accessories, Features, and Users) can be created, read, updated and deleted at any time. Deletions will cascade through the database(s) to remove any unused items. Anything that relies on the deleted item, as a key, will be deleted as well.','utf-8'),(64,'==How to Create and Print a Price-Sheet==\n\n===Create the features (Features tab).===\n  a) Click add.\n  b) Enter feature name.\n  c) Enter model code.\n  d) Press Create Feature.\nRepeat for each feature that is to be created.\nThe model code is used so that the system will be able to display only relevant features when creating a vehicle.\n\n===Create the vehicle (Vehicles tab).===\n  a) Click Add.\n  b) Enter all fields.\n  c) Enter as many option codes as needed.\n  d) Select desired vehicle features.\n  e) Press Create Package.\n  f) Repeat steps \'d\' and \'e\' for each option code entered.\n\n===Create the accessories (Accessories tab).===\n  a) Enter accessory name.\n  b) Enter model code.\n  c) Press Create Accessory.\nRepeat for each accessory that is to be created.\n\n===Create the Price-Sheet (Price-Sheets tab).===\n  a) Click Add.\n  b) Enter vehicle model code.\n  c) Enter vehicle option code.\n  d) Select accessories.\n  e) Enter exterior colour.\n  f) Enter interior colour.\n  g) Press Create Price-Sheet.\n\n===Print the Price-Sheet (Price-Sheets tab).===\n  a) Click Print (for the price-sheet to be printed).\n  b) Enter serial number.\n  c) Enter stock number.\n  d) Select number of copies.\n  e) Press Print Price-Sheet.\n\n==Additional Information on Price-Sheet Creation==\n\nBuilding a price-sheet is a layered process. A price-sheet requires two components: a vehicle and a set of accessories. A vehicle object contains base vehicle information as well as a feature package. A feature package requires a set of individual features. This means that a set of features (ex. Moon Roof, Fog Lights, Dual-Zone A/C, etc) must be created during the vehicle creation process. Once this is done, the features are grouped together to create a feature package (ex. Standard, Convenience, Luxury, etc). A vehicle object can then be created by selecting the year, make, model code, option code, and feature package.\n\nOnce a vehicle object has been created, its (optional) accessories (ex. After Market Rims, THULE Rack Mount, Cargo Mats, etc) can be created in the Accessories tab. A price-sheet can then be created by selecting a vehicle object and a custom set of dealer-specific accessories.\n\nEach object (Price-Sheets, Vehicles, Accessories, Features, and Users) can be created, read, updated and deleted at any time. Deletions will cascade through the database(s) to remove any unused items. Anything that relies on the deleted item, as a key, will be deleted as well.','utf-8');
